import React, { useState, useEffect } from 'react'

import PetPostDetails from './PetPostDetails'

export const PetPostPage = () => {
  const [ petList, setPetList ] = useState([]);
  const [ error, setError ] = useState('');

  const fetchPetList = () => {
    fetch("http://localhost:8080/petposts")
    .then(res => res.json())
    .then(json => setPetList(json.results))
    .catch(err => {
      setError(err)
    })
  }

  useEffect(() => {
    fetchPetList()
  }, [])


  return (
    <div className="pet-list-container">    
        {/* {petList.map(pets => {   */}
            return (
                <PetPostDetails />
            )
        // })}
        { error && <p>Something went not so great. Details {error}</p> }
    </div>
  )
}

export default PetPostPage
